import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Layout from './components/Layout';

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path='/'>
            <Layout />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
